import React, { Component } from 'react';

class Login_Register extends Component {
    constructor(props) {
        super(props);
        this.state = {
          isLoginOpen: true,
          isRegisterOpen: false
        };
    }

    render(){
        return(
            <div>Login_Register</div>
            );
    }
}
























export default Login_Register;
